*Koordinasi dan Silaturahmi FKRW Kelurahan Kotabaru Kecamatan Bekasi Barat*

Sabtu, 13 September 2025 – Forum Komunikasi RW (FKRW) se-Kelurahan Kotabaru menggelar acara koordinasi dan silaturahmi pada Sabtu, 13 September 2025, pukul 20.00 WIB di halaman kantor RW 17. Acara ini bertujuan untuk mempererat tali silaturahmi serta menyinergikan program-program kerja antar RW.

Acara dibuka oleh perwakilan pengurus FKRW, Bapak Sutiyo, dengan tema pertemuan rutin dua bulanan. Agenda utama meliputi sosialisasi terkait dana hibah sebesar 100 juta rupiah dari Pemerintah Kota Bekasi yang akan dialokasikan untuk masing-masing RW.

Turut hadir dalam acara tersebut perwakilan dari berbagai elemen masyarakat dan pemerintahan, antara lain:

- Camat Bekasi Barat, yang diwakili oleh Bapak Joko (Kasi Pemerintahan Kecamatan Bekasi Barat)
- Lurah Kotabaru
- Kasi Kessos Kelurahan Kotabaru
- Pengurus FKRW Kotabaru
- LPM Kotabaru
- BKM Kotabaru
- Kepala Puskesmas Kotabaru
- Bhimaspol Kotabaru
- Babinsa Kotabaru
- Ketua RW 01 hingga RW 22
- Aparatur Kelurahan Kotabaru
- Tokoh masyarakat Kelurahan Kotabaru

Dalam sambutannya, Bapak Joko menyampaikan apresiasi atas inisiatif FKRW dalam mengumpulkan para ketua RW serta tokoh masyarakat untuk membahas program-program pembangunan yang akan datang. Ia juga menekankan pentingnya transparansi dan akuntabilitas dalam pengelolaan dana hibah agar dapat memberikan manfaat maksimal bagi masyarakat, termasuk pemanfaatan kembali bank sampah di wilayah RW masing-masing.

Acara berlangsung dengan lancar dan penuh keakraban, diakhiri dengan sesi diskusi serta ramah tamah antar peserta. Diharapkan, kegiatan ini dapat semakin memperkuat sinergi antara pemerintah, FKRW, dan masyarakat dalam membangun Kelurahan Kotabaru yang lebih baik.

